import React from 'react';
function EmployeeDetail({ employee, index, attendence,removeEmployee }) {
  return (
    <div
      className={`employee-list ${employee.isAbsent ? 'absent' : 'present' }`}
    >
      {employee.name}
      <span>{employee.employeeId}</span>
      <div>
        <button onClick={() => attendence(index)}>Absent</button>
        <button onClick={() => removeEmployee(index)}>Remove</button>
      </div>
    </div>
  );
};

export default EmployeeDetail;
